import React from 'react';
import { Form, Input, Button, Checkbox, Typography } from 'antd';
import { WrapperLogin, WrapperTitle, MainContainer, Registrate, CustomCard } from './styled';

const { Title, Text } = Typography;

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const Signup = ({ setShowComponent }) => {
  const onFinish = (values) => {
    console.log('Success:', values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };
  return (
    <MainContainer>
      <CustomCard>
        <Registrate>
          <Text type='secondary' style={{ color: 'red', marginRight: '-10px', marginTop: '-20px' }}>
            Ya tienes una cuenta?
          </Text>{' '}
          <Button
            type='link'
            style={{ marginTop: '-25px', color: 'red', marginRight: '-10px' }}
            onClick={() => setShowComponent({ Login: true, Recover: false, Signup: false })}>
            Iniciar Sesion
          </Button>
        </Registrate>{' '}
        <br />
        <br />
        <WrapperTitle>
          <Title type='secondary'>Registrarse</Title>
        </WrapperTitle>
        <br />
        <br />
        <WrapperLogin>
          <Form
            {...layout}
            name='basic'
            initialValues={{ remember: true }}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}>
            <Form.Item
              label='Nombre'
              name='name'
              rules={[{ required: true, message: 'Ingrese nombre de usuario' }]}>
              <Input placeholder='Ingrese nombre' />
            </Form.Item>

            <Form.Item
              label='Email'
              name='email'
              rules={[{ required: true, message: 'Ingrese email' }]}>
              <Input placeholder='Ingrese email' />
            </Form.Item>

            <Form.Item
              label='Contrase単a'
              name='password'
              rules={[{ required: true, message: 'Ingrese contrase単a' }]}>
              <Input.Password placeholder='Ingrese contrase単a' />
            </Form.Item>

            <Form.Item {...tailLayout}>
              <Button type='primary' htmlType='submit'>
                Submit
              </Button>
            </Form.Item>
          </Form>
        </WrapperLogin>
      </CustomCard>
    </MainContainer>
  );
};

export default Signup;
